import { useState } from "react";
import Form from "./Form";
import Pres from "./Pres";
import {
  Button,
  Typography,
  Grid,
  Paper,
  AppBar,
  Toolbar,
} from "@mui/material";

const About = () => {
  const [open, setOpen] = useState(false);
  const [prescription, setPrescription] = useState(false);
  const [data, setData] = useState([]);

  return (
    <div
      className="min-h-screen"
      style={{
        backgroundImage: "url('background-image.jpg')",
        backgroundSize: "cover",
        backgroundPosition: "center",
      }}
    >
      <AppBar position="static" color="transparent" elevation={0}>
        <Toolbar className="justify-between">
          <Typography variant="h6">Ayurmedic</Typography>
          <div>
            <Button color="inherit">Home</Button>
            <Button color="inherit">About</Button>
            <Button color="inherit">Contact Us</Button>
            <Button color="inherit">Log In</Button>
          </div>
        </Toolbar>
      </AppBar>
      <div className="container mx-auto px-4 py-8">
        {!prescription && (
          <>
            <div className="text-center mb-8">
              <Typography variant="h3">AYURMEDIC</Typography>
              <Typography variant="subtitle1">
                Unpacking Ayurveda is a New Luxury.
              </Typography>
              <Button
                variant="contained"
                onClick={() => setOpen(true)}
                style={{ backgroundImage: "url('get-started.jpg')" }}
              >
                Get Started
              </Button>
            </div>
            <Form
              open={open}
              setOpen={setOpen}
              data={data}
              setData={setData}
              setPrescription={setPrescription}
            />
            <Grid container spacing={3}>
              <Grid item xs={12} sm={4}>
                <Paper className="p-4 text-center">
                  <Button
                    variant="contained"
                    onClick={() => setOpen(true)}
                    fullWidth
                    style={{ backgroundImage: "url('diagnose-yourself.jpg')" }}
                  >
                    Diagnose yourself
                  </Button>
                </Paper>
              </Grid>
              <Grid item xs={12} sm={4}>
                <Paper className="p-4 text-center">
                  <Button
                    variant="contained"
                    fullWidth
                    style={{ backgroundImage: "url('doctor-character-background_1270-84.avif')" }}
                  >
                    Consult a specialist
                  </Button>
                </Paper>
              </Grid>
              <Grid item xs={12} sm={4}>
                <Paper className="p-4 text-center">
                  <Button
                    variant="contained"
                    fullWidth
                    style={{ backgroundImage: "url('view-prescriptions.jpg')" }}
                  >
                    View past prescriptions
                  </Button>
                </Paper>
              </Grid>
            </Grid>
          </>
        )}
        {prescription && <Pres data={data} />}
      </div>
    </div>
  );
};

export default About;
